import React, { Component, lazy, Suspense } from "react";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom"
import Operators from "./components/Operator"

const routes = [
  {
    path: '/',
    component: Operators,
    viewbyfaction
  },
  {
    path: '/operators',
    component: Operators,
    viewbyfaction
  }
]

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      activeItem: {
        operator: ""
      },
      operator: [],
      viewbyfaction: false,
      viewbyrelease: false,
      viewall: false,
      faction: 50,
      release: 50
    };
  }
  render() {
    return (
      <Router>
        {routes.map(({ path, component: C, viewbyfaction }))} => (
          <Route
            path = {path}
            render={(props) => (<C {...props} viewbyfaction />)} />
          />
        )
      </Router>
    )
  }
}

export default App;
